import React from "react";
import UserItem from "./UserItem";

const UsersList = (props) => {
  if (props.items.length === 0) {
    return (
      <div>
        <h2>User Not Found</h2>
      </div>
    );
  }
  return (
    <div>
      <ul>
        {props.items.map((user) => {
          return (
            <UserItem
              key={user.id}
              id={user.id}
              image={user.image}
              name={user.name}
              postCount={user.posts}
            />
          );
        })}
      </ul>
    </div>
  );
};

export default UsersList;
